import './App.css';
import {BrowserRouter as Router, Routes ,Route} from "react-router-dom";
import Nav from './components/Nav';
import Home from './components/Home';

function App() {
  return (
    <div className='wrapper'>
      <Router>
      <Nav/>
      <Routes>
        <Route exact path="/" element={<Home/>} />
      </Routes>      
    </Router>
    </div>
  );
}

export default App;
